import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { getImageURL } from '../../services/api';
import './MyBookings.css';

function MyBookings({ user }) {
  const navigate = useNavigate();
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    if (!user) {
      setError('Please login to view your bookings');
      setLoading(false);
      return;
    }

    // Load bookings from localStorage
    loadBookings();
  }, [user]);

  const loadBookings = () => {
    try {
      const storedBookings = localStorage.getItem('userBookings');
      if (storedBookings) {
        const parsedBookings = JSON.parse(storedBookings);
        setBookings(parsedBookings);
      } else {
        setBookings([]);
      }
    } catch (err) {
      console.error('Error loading bookings:', err);
      setError('Error loading bookings');
      setBookings([]);
    } finally {
      setLoading(false);
    }
  };

  const getStatusColor = (status) => {
    switch(status) {
      case 'pending': return 'status-pending';
      case 'confirmed': return 'status-confirmed';
      case 'completed': return 'status-completed';
      case 'cancelled': return 'status-cancelled';
      default: return 'status-default';
    }
  };

  const formatDate = (dateString) => {
    return new Date(dateString).toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'long',
      day: 'numeric'
    });
  };

  const formatTime = (timeString) => {
    return timeString.slice(0, 5); // HH:MM format
  };

  if (loading) {
    return (
      <div className="my-bookings-container">
        <div className="loading-spinner">
          <div className="spinner"></div>
          <p>Loading your bookings...</p>
        </div>
      </div>
    );
  }

  if (error && !user) {
    return (
      <div className="my-bookings-container">
        <div className="error-container">
          <div className="error-icon">‚ö†Ô∏è</div>
          <h2>Access Denied</h2>
          <p>{error}</p>
          <button onClick={() => navigate('/login')} className="btn-primary">
            Go to Login
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="my-bookings-container">
      <div className="bookings-wrapper">
        {/* Header */}
        <div className="bookings-header">
          <div className="header-content">
            <div className="header-text">
              <h1>My Bookings</h1>
              <p>Welcome back, {user?.username || user?.full_name || 'User'}!</p>
            </div>
            <div className="header-actions">
              <div className="booking-count">
                <span className="count-label">Total Bookings</span>
                <span className="count-number">{bookings.length}</span>
              </div>
              <button onClick={() => navigate('/')} className="btn-back">
                ‚Üê Back to Home
              </button>
            </div>
          </div>
        </div>

        {/* Bookings List */}
        {bookings.length === 0 ? (
          <div className="no-bookings">
            <div className="no-bookings-icon">üì¶</div>
            <h3>No Bookings Yet</h3>
            <p>You haven't made any bookings. Start exploring our artworks!</p>
            <button onClick={() => navigate('/')} className="btn-primary">
              Browse Artworks
            </button>
          </div>
        ) : (
          <div className="bookings-list">
            {bookings.map((booking, index) => (
              <div key={booking.booking_id || index} className="booking-card">
                <div className="booking-card-inner">
                  {/* Artwork Image */}
                  <div className="booking-image">
                    <img 
                      src={booking.artwork_image || getImageURL(booking.image_url)} 
                      alt={booking.artwork_title}
                      onError={(e) => {
                        e.target.src = 'https://via.placeholder.com/300x400?text=Artwork';
                      }}
                    />
                  </div>

                  {/* Booking Details */}
                  <div className="booking-details">
                    <div className="booking-header-row">
                      <div>
                        <h3 className="booking-title">{booking.artwork_title}</h3>
                        <p className="booking-id">Booking ID: #{booking.booking_id}</p>
                      </div>
                      <span className={`booking-status ${getStatusColor(booking.status)}`}>
                        {booking.status.charAt(0).toUpperCase() + booking.status.slice(1)}
                      </span>
                    </div>

                    <div className="booking-info-grid">
                      {/* Customer Info */}
                      <div className="info-section">
                        <h4>üë§ Customer Details</h4>
                        <p><strong>Name:</strong> {booking.customer_name}</p>
                        <p><strong>Email:</strong> {booking.email}</p>
                        <p><strong>Phone:</strong> {booking.phone}</p>
                      </div>

                      {/* Delivery Info */}
                      <div className="info-section">
                        <h4>üöö Delivery Details</h4>
                        <p><strong>Date:</strong> {formatDate(booking.preferred_date)}</p>
                        <p><strong>Time:</strong> {formatTime(booking.preferred_time)}</p>
                        <p><strong>Address:</strong> {booking.delivery_address}</p>
                      </div>
                    </div>

                    {/* Special Instructions */}
                    {booking.special_instructions && (
                      <div className="special-instructions">
                        <h4>üìù Special Instructions:</h4>
                        <p>{booking.special_instructions}</p>
                      </div>
                    )}

                    {/* Footer */}
                    <div className="booking-footer">
                      <div className="booking-date">
                        <p>Booked on {formatDate(booking.created_at)}</p>
                      </div>
                      <div className="booking-amount">
                        <span className="amount-label">Total Amount</span>
                        <span className="amount-value">
                          ‚Çπ{(booking.total_amount || booking.artwork_price || 0).toLocaleString()}
                        </span>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
}

export default MyBookings;
